import React, { Component } from 'react'
import './index.css'
import { Input } from 'antd'

class ReservaML extends Component{
  render(){
    return(
      <div className='div-card-ML'>
        <div className='linhaTexto-ML'>
          <h1 className='h1-ML'>Reserva mercado-livre</h1>
        </div>

        <div className='div-linha-Os'>
        <div className='div-nOs-Os'>
          <div className='div-textOs-Os'>NÂº Os:</div>
            <Input
              className='input-100'
              style={{ width: '100%' }}
              name='Os'
              value={this.state.Os}
              placeholder="3203"
              onChange={this.onChange}
              onBlur={this.onBlurValidator}
              allowClear
            />
          </div>

        </div>
      </div>
    )
  }
}

export default ReservaML
